    true,nt"url": null,nt"notes": "The GPM Ground Validation NASA Micro Rain
    Radar (MRR) is a vertically pointing Doppler radar which provides measurements of
    vertical velocity, drop size distribution, rainfall rate, attenuation, liquid water
    content, and reflectivity factor obtained during the GPM Cold-season Precipitation
    Experiment (GCPEx), which took place in Canada during Winter 2011-2012.  The MRR
    is a frequency-modulated continuous wave (FMCW) vertically pointing Doppler radar,
    which operates at 24.24GHz, and it is the second generation of the instrument manufactured
    by METEK (http://www.metek.de/product-details/mrr-2.html).  NASA MRR data was collected
    from late October 2011 through March 2013.",nt"license_title": "U.S. Government
